import React from 'react';


 const   SectionService = (props) =>{
    return(
        <>
           
                        <div className="card"  className="card-img-top" style={{width: '18rem'}}>
                            <span>{props.icon}</span>
                        <div className="card-body">
                            <h5 className="card-title">{props.title}</h5>
                            <p className="card-text">{props.text}.</p>
                         </div>
                         </div>
                         <div className="col-md-4 col-10 mx-auto">
                    <div className="card my-5" style={{width: '18rem',borderRadius:'15px'}}>
                    <span>{props.icon}</span>
                        <div className="card-body">
                            <h5 className="card-title">{props.title}</h5>
                            <p className="card-text">{props.text}</p>
                            <NavLink to='' className="btn btn-primary btn1">Go somewhere</NavLink>
                        </div>
                    </div>
                    </div>   
                    
           
        </>
    );
};
export default SectionService;
